  b 17.04.1976
  Scott b. at Auckland.
  02>' DAVIES, Leofric Pearson
  b 11.09.1883 d 15.04.1955
  Leofric b. at Wellington and bd. at St Mary's, Karori, Wellington.
  Leo was educated at Wanganui Collegiate School (1898-1901) and was a member of the 1st rugby
  XV in 1901. He studied dentistry as an apprentice to two Wellington dental surgeons then
  furthered his studies in Philadelphia, Edinburgh and London, On his return to New Zealand he
  entered private practice in Woodward Street, Wellington. Along with his elder brother,
  Godfrey, he was a foundation member of the Karori Hockey Club, a sport in which he gained
  representative honours. Leo served as a Karori Borough Councillor (1913-16) before proceeding overseas with
  the 1st NZEF Dental Corps. For his service as officer in charge of the dental section at Codford Camp in
  England he was made an officer of the Most Excellent Order of the British Empire (OBE). Leo played an
  active role in the Dental Association and served a term as President of the Wellington Branch. In WW2 he
  was an Assistant Director of Dental Services with the rank of Major from 1939 to 1942. He took a keen
  interest in dental education and the University of Otago has established the Leo P Davies Prize in
  Preventive Dentistry in his memory.
  63> DAVIES, Ethleen Rose
  b 28.07.1885 d 04.11.1945
  Ethleen b. at Karori and bd, at St Mary's, Karori, Wellington. She and her sister, Gwen
  travelled widely in England, Europe, Africa and Asia.
  04> DAVIES, Gwen Temple
  b 12.06.1887. d 10.11.1970
  Gwen b, at Karori and bd. at St Mary's, Karori, Wellington. She and her sister, Ethleen, travelled widely
  in England, Europe, Africa and Asia.
  05> DAVIES, Edith Race m on 31.07.1923 to MILLER, Harold Gladstone
  b 05.05.1890 d 28.07.1976
  b 15.05.1898 d 04.03.1989
  Edith b. at Karori and both Edith and Harold bd, at St Mary's, Karori, Wellington.
  Edith remembered meeting most of Henry and William Williams' children, and at the
  1973 Reunion she was the oldest living descendant present. When she was very young
  she remembered travelling with Samuel Williams in a horse and trap and him singing
  at the top of his voice, "What a friend I have in Jesus....", then at the marae,
  'taking off his jacket and leaping around with the Maoris'. She also visited the
  Hukarere great aunts.
  Edith grew up in Karori, Wellington where she spent most of her 86 years. Her early education was from a
  governess with the cousins of Katherine Mansfield, the Waters children, followed by Miss Thornton's School
  at Napier (Miss Thornton's brother was headmaster at Te Aute College). There she received a lady-like
  education with great emphasis on deportment, promenading with a book balanced on her head, and learning how
  to get into and out of carriages. In 1907 she was coached by one of the first woman graduates and in 1908
  she enrolled at. Wellington Teachers' College and Victoria University College. In 1908 there was a
  rationalist environment at the University, and a crisis in belief was greatly helped by the 1910 Anglican
  Mission to New Zealand. She completed an MA with Hons in English and French, while at the same time
  teaching at Miss Baber's School (later called Samuel Marsden Collegiate School). It was a case of earn by
